webpackJsonp([0xb4fb800fd499],{1181:function(e,a){e.exports={data:{markdownRemark:{html:"<p>The lexicographical publishing house urged \"Ci Hai\" to revise the entry of political science, and quickly put the original items in the computer and sent them. The dictionary is now a hot spot, but there are not many people who seem to be arrogant. Recently, there are many lawsuits in this area. There are too many people to write, and the editors can't control them. The following people copy them everywhere, and some of them are scissors. Be especially careful when writing a dictionary later. There is also morality here, which is an academic morality.</p>\n<p>The Japan International Forum sent a fax to confirm that I would go to Japan on a monthly basis to give a speech on China's development and security in Asia. The Japan International Forum is a policy advisory body. According to the materials sent, it has a certain influence and seems to be a non-governmental organization. Issue policy recommendations on Japan's foreign policy. A few copies of their policy reports were sent: such as strengthening relations with Europe, China's development and Japan's prospects, and the development of the US-Russia-Japan trilateral relationship. Japanese research institutions should be said to be developed and imitate the American approach. However, Japan has its own characteristics. Large research institutions are supported by large companies. There are not many purely private and independent research institutions. The research institutions of large companies are very powerful, with strong capital and sensitive information. They have offices in all countries. Sometimes, intelligence is more sensitive than the Ministry of Foreign Affairs. It may be that a kind of consciousness is at work. The Japanese are always afraid of the power of foreign countries. The awareness of the island nation is particularly strong. They are particularly concerned about what happened in other countries and what kind of impact they have on themselves. And some land powers do not seem to care so much about it. Anyway, I can't take me anyway. I do my business.</p>\n<p>Going home at 11 o'clock in the evening, only those who sell petrol tickets are still in full swing.</p>",id:"/home/swain/workspace/political-life/src/pages/en/0035.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/en/0035.md",frontmatter:{title:"February 18th Friday"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/en/0035.md absPath of file >>> MarkdownRemark"}}}});
